import React from "react";
import BootstrapTable from "react-bootstrap-table-next";

const Wines = () => {
  const columns = [
    {
      dataField: "id",
      text: "Product ID",
    },
    {
      dataField: "name",
      text: "Product Name",
    },
    {
      dataField: "price",
      text: "Product Price",
    },
  ];
  return <div>Wines</div>;
};

export default Wines;
